import React from 'react'


export default function  Incio({data}){
  return (
              <div>
                    <br></br>

                    <div>
                    <h1>API START WARS</h1>  
                    </div>

              <h5 className="card-title">Personajes</h5>
              <p className="card-text" >Lista de Personajes</p>
               {data.map((personaje,i)=>{

                  return(
                      <div key={i}>


                            <div    classNameclass="card" style="width: 18rem;">
                            <img    className="card-img-top"  src="..."  alt="..."/>
                              <div  classNameclass="card-body">
                                <h5 classNameclass="card-title">Card title</h5>
                                <p  classNameclass="card-text">Some content.</p>
                                <a  classNameclass="btn btn-primary" href="#" >Go somewhere</a>
                              </div>
                            </div>


                      </div>

                  )

               })} 

              </div>

              )








